import React from 'react';



const CustomerList = (props) => {
    if(props.data) {
        const mappedList = props.data.map((item) => {
            return (
                <div key={item.id}>
                    <p>{item.id}</p>
                    <p>{item.firstName}</p>
                    <p>{item.lastName}</p>
                    <p>{item.country}</p>
                </div>
            )
        });
        return mappedList;
    } else {
        return (
            <div />
        );
    }
}

export default CustomerList;
